export default function Instructor() {
    var [instructor, setInstructor] = useState([]);
    useEffect(() => {
        fetch('localhost:5000/todos')

        .then(res => res.json())
        .then(instructor => setInstructor(instructor));
    }, []);

    return (    
        <div className="instructor">
            <h1>Instructor</h1>

        </div>
    )

}
